;; **
;;; ## Simple functions
;; **

;; @@
(def xs (range 0.0 30.0 1.0))
(def coords (mapv (fn [x] [x]) xs))
;; @@
;; =>
;;; {"type":"html","content":"<span class='clj-var'>#&#x27;algebolic.demo.spea2/coords</span>","value":"#'algebolic.demo.spea2/coords"}
;; <=

;; @@
(def data (map (fn [x] (- (+ (* 2 x) (* 3 x x)) (* 0.09 x x x))) xs))
;; @@
;; =>
;;; {"type":"html","content":"<span class='clj-var'>#&#x27;algebolic.demo.spea2/data</span>","value":"#'algebolic.demo.spea2/data"}
;; <=

;; @@
(def data (map (fn [x] (Math/sin (/ x 4))) xs))
;; @@
;; =>
;;; {"type":"html","content":"<span class='clj-var'>#&#x27;algebolic.demo.spea2/data</span>","value":"#'algebolic.demo.spea2/data"}
;; <=

;; @@
(def data (map (fn [x] (+ (Math/sin (/ x 5)) (* 2 (Math/sin (/ x 3))) (* 3 (Math/sin (/ x 2))))) xs))
;; @@
;; =>
;;; {"type":"html","content":"<span class='clj-var'>#&#x27;algebolic.demo.spea2/data</span>","value":"#'algebolic.demo.spea2/data"}
;; <=

;; @@
(def vars '[x])
(def functions (expression/get-functions #{:plus :minus :times}))
(def terminals (expression/terminal-generators vars))
;; @@
;; =>
;;; {"type":"html","content":"<span class='clj-var'>#&#x27;algebolic.demo.spea2/terminals</span>","value":"#'algebolic.demo.spea2/terminals"}
;; <=

;; @@
(def generation-config
  (let [size-limit 80
        min-size 15
        ea-config (spea2/spea2-config
                    {:goals [:error :complexity]
                     :archive-size 50
                     :binary-ops [{:op (partial genetics/ninety-ten-sl-crossover size-limit) :repeat 23}]
                     :unary-ops [{:op (partial genetics/random-tree-mutation functions terminals 3) :repeat 4}]})
        score-functions {:complexity tree/count-nodes
                         :error (fn [ex] (score/abs-error vars coords data ex))}]
    {:ea-config              ea-config
     :transformations        [(partial transform/apply-to-fraction-of-genotypes
                                       (partial transform/hill-descent
                                                genetics/twiddle-constants
                                                (:error score-functions))
                                       0.5)
                              (partial transform/apply-to-all-genotypes
                                       (partial genetics/trim-hard size-limit))
                              (partial transform/apply-to-all-genotypes
                                       (partial genetics/boost-hard min-size
                                                #(genetics/random-full-tree functions terminals 3)))]
     :score-functions        score-functions
     :stopping-condition     #(>= (:age %) 500)
     :reporting-function     (fn [z] (print ".") (flush))}))
;; @@
;; =>
;;; {"type":"html","content":"<span class='clj-var'>#&#x27;algebolic.demo.spea2/generation-config</span>","value":"#'algebolic.demo.spea2/generation-config"}
;; <=

;; @@
(def initial-zeitgeist
  (evolution/make-zeitgeist (genetics/full-population functions terminals 50 7)))
;; @@
;; =>
;;; {"type":"html","content":"<span class='clj-var'>#&#x27;algebolic.demo.spea2/initial-zeitgeist</span>","value":"#'algebolic.demo.spea2/initial-zeitgeist"}
;; <=

;; @@
(time (def result (evolution/run-evolution generation-config initial-zeitgeist)))
